Select patients for the treatment of locally advanced or metastatic NSCLC with ENSACOVE based on the presence of ALK rearrangement(s) in tumor specimens [see Clinical Studies (

                              14.1

                           )]. An FDA-approved test to detect ALK rearrangements for selecting patients for treatment with ENSACOVE is not currently available.

Prior to initiating ENSACOVE, evaluate liver function tests [see Warnings and Precautions (

                              5.2

                           )] and fasting blood glucose [see Warnings and Precautions (

                              5.5

                           )].

The recommended dosage of ENSACOVE is 225 mg orally once daily, with or without food [see Clinical Pharmacology (

                              12.3

                           )], until disease progression or unacceptable toxicity.

ENSACOVE is contraindicated in patients who have experienced a severe hypersensitivity reaction to ENSACOVE, FD&C Yellow No. 5 (tartrazine), or to any of its components [see Warnings and Precautions (

                        5.10

                     )].

In the pooled safety population [see Adverse Reactions (

                              6.1

                           )], ILD/pneumonitis occurred in 5% of patients treated with ENSACOVE, including Grade 3 in 1.3% and Grade 4 in 0.4%.

Monitor patients for new or worsening symptoms indicative of ILD/pneumonitis (e.g., dyspnea, cough, and fever) during treatment with ENSACOVE. Immediately withhold ENSACOVE in patients with suspected ILD/pneumonitis. Permanently discontinue ENSACOVE if ILD/pneumonitis is confirmed [see Dosage and Administration (

                              2.4

                           )].

In the pooled safety population [see Adverse Reactions (

                              6.1

                           )], 59% of patients treated with ENSACOVE had increased alanine aminotransferase (ALT), including 5% Grade 3. Increased aspartate aminotransferase (AST) occurred in 58% of patients treated with ENSACOVE, including 1.8% Grade 3. Increased bilirubin occurred in 12% of patients treated with ENSACOVE, including 2.3% Grade 3 and 0.2% Grade 4. There was one case of drug-induced liver injury in ENSACOVE-treated patients.

Monitor liver function tests including ALT, AST, and total bilirubin at baseline and every 2 weeks during the first cycle of treatment with ENSACOVE, and then monthly and as clinically indicated. Withhold, reduce the dose, or permanently discontinue ENSACOVE based on the severity of the adverse reaction [see Dosage and Administration (

                              2.4

                           )].

In the pooled safety population [see Adverse Reactions (

                              6.1

                           )], dermatologic adverse reactions occurred in 80% of patients receiving ENSACOVE, including Grade 3 in 14% of patients. Rash occurred in 72% of patients receiving ENSACOVE, including Grade 3 in 12% of patients. The median time to onset of rash was 9 days (range: 1 day to 17.3 months). Pruritus occurred in 32% of patients receiving ENSACOVE, with Grade 3 in 2.4%. There was one Grade 3 case (0.2%) of drug reaction with eosinophilia and systemic symptoms (DRESS).

In the pooled safety population [see Adverse Reactions (


                                 6.1


                                 )
                              ], photosensitivity occurred in 0.9% of patients receiving ENSACOVE; all were Grade 1.

Monitor patients for dermatologic adverse reactions during treatment with ENSACOVE. If dermatologic adverse reactions occur, treat with antihistamine, topical or systemic steroids based on the severity. Advise patients to limit direct sun exposure while taking ENSACOVE and for at least 1 week after discontinuation. Withhold, reduce the dose, or permanently discontinue ENSACOVE based on the severity of the adverse reaction [see Dosage and Administration (

                              2.4

                           )].

In the pooled safety population [see Adverse Reactions (

                              6.1

                           )], bradycardia (heart rate less than 60 beats per minute) occurred in 6% of patients treated with ENSACOVE. All bradycardia events were Grade 1 or 2. Bradycardia requiring dose reduction occurred in 0.2% and led to dose interruption in 0.4% of ENSACOVE-treated patients.

Monitor heart rate regularly during treatment with ENSACOVE. Withhold, reduce the dose, or permanently discontinue ENSACOVE based on severity [see Dosage and Administration (

                              2.4

                           )].

In the pooled safety population [see Adverse Reactions (

                              6.1

                           )], based on laboratory data, 44% of patients receiving ENSACOVE experienced increased blood glucose, including Grade 3 in 2.5%. The median time to onset of increased blood glucose was 5.9 weeks (0.4 weeks to 3.4 years).

Assess fasting serum glucose at baseline and monitor serum glucose periodically during treatment with ENSACOVE. Withhold, reduce the dose, or permanently discontinue ENSACOVE based on severity [see Dosage and Administration (

                              2.4

                           )].

In the pooled safety population [see Adverse Reactions (

                              6.1

                           )], 8% of patients receiving ENSACOVE experienced visual disturbance, including 0.2% Grade 3. Visual disturbances led to dose interruption in 0.4% of patients.

Obtain an ophthalmologic evaluation in patients with new or worsening visual symptoms during treatment with ENSACOVE. Withhold, reduce the dose, or permanently discontinue ENSACOVE based on severity [see Dosage and Administration (

                              2.4

                           )].

In the pooled safety population [see Adverse Reactions (

                              6.1

                           )], of the 203 patients with creatine phosphokinase (CPK) laboratory data available, increased CPK occurred in 43% of patients who received ENSACOVE. The incidence of Grade 3 increased CPK was 1.5% and 0.5% were Grade

Advise patients to report any unexplained muscle pain, tenderness, or weakness. Monitor CPK levels during treatment with ENSACOVE. Withhold, reduce the dose, or permanently discontinue ENSACOVE based on severity [see Dosage and Administration (

                              2.4

                           ), Adverse Reactions (

                              6.1

                           )].

In the pooled safety population [see Adverse Reactions (

                              6.1

                           )], based on adverse reactions, 6% of patients experienced hyperuricemia, with 0.4% Grade 3 and 0.7% Grade 4. Nine patients (1.9%) required hydration and two patients (0.4%) required urate-lowering medication.

Monitor serum uric acid levels prior to initiating ENSACOVE and periodically during treatment. Initiate treatment with urate-lowering medications as clinically indicated. Withhold, reduce the dose, or permanently discontinue ENSACOVE based on severity [see Dosage and Administration (

                              2.4

                           )].

