The safety of ENSACOVE was evaluated in the eXALT3 study [see Clinical Studies (
                              14.1)
                           ]. Patients received ENSACOVE 225 mg orally once daily, with or without food, until disease progression or unacceptable toxicity. Among patients who received ENSACOVE, 78% were exposed for 6 months or longer and 66% were exposed for greater than one year.

